import React from 'react';

const Card = ({ name, email, id }) => {
	return ( 
		<div className='tc grow bg-gray br3 pa3 ma2 dib bw2 shadow-5'>
			<div>
				<h1>{id}</h1>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}

export default Card;
